(ns spacial-dusk
  (:import 
    [org.opencv.core Core Point Rect Mat CvType Size Scalar]
    org.opencv.imgcodecs.Imgcodecs
    org.opencv.imgproc.Imgproc)
  (:require 
    [opencv3.utils :as u]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def neko 
  (u/load-mat-from-url "https://s-media-cache-ak0.pinimg.com/236x/10/2c/75/102c756d7e808deff666f3edf540abba.jpg"))
(u/mat-view neko)
