;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"236\" height=\"295\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x532e2afa \"BufferedImage@532e2afa: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@3946eec0 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 236 height = 295 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def small-gray-neko (u/quick-zoom gray 0.5 Imgproc/INTER_LINEAR))
(u/mat-view small-gray-neko)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"118\" height=\"147\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5e0d85c9 \"BufferedImage@5e0d85c9: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@3946eec0 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 118 height = 147 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def equalized (Mat.))
(Imgproc/equalizeHist small-gray-neko equalized)
(u/mat-view equalized)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"118\" height=\"147\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x10ba2de3 \"BufferedImage@10ba2de3: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@3946eec0 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 118 height = 147 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def dilated (u/mat-from small-gray-neko))
(def dilation-size 2)
(def element (Imgproc/getStructuringElement  Imgproc/MORPH_RECT
  (Size. (inc (* 2 dilation-size)) (inc (* 2 dilation-size)))))
(Imgproc/dilate small-gray-neko dilated element)
(u/mat-view dilated)
